// Parse Altium Netlist (.NET file) - WITH DEBUGGING
try {
  console.log('=== NETLIST PARSER START ===');

  // Get file data - try different formats
  let content = '';

  const inputData = $input.first();
  console.log('Input data structure:', JSON.stringify(inputData, null, 2));
  console.log('Input data keys:', Object.keys(inputData));

  if (inputData.binary) {
    console.log('Binary data detected');
    console.log('Binary keys:', Object.keys(inputData.binary));
    console.log('Binary.data type:', typeof inputData.binary.data);
    console.log('Binary.data keys (if object):', inputData.binary.data ? Object.keys(inputData.binary.data) : 'null');
  }

  // Try to get content from different possible sources
  if (inputData.binary && inputData.binary.data) {
    console.log('Attempting binary data extraction...');
    // File is in binary format - handle different binary data structures
    if (typeof inputData.binary.data === 'string') {
      console.log('Binary data is string, length:', inputData.binary.data.length);
      // Direct base64 string
      content = Buffer.from(inputData.binary.data, 'base64').toString('utf-8');
      console.log('Converted from base64 string');
    } else if (inputData.binary.data.data && typeof inputData.binary.data.data === 'string') {
      console.log('Binary data nested in .data property, length:', inputData.binary.data.data.length);
      // Binary data nested in .data property
      content = Buffer.from(inputData.binary.data.data, 'base64').toString('utf-8');
      console.log('Converted from nested base64 string');
    } else if (Buffer.isBuffer(inputData.binary.data)) {
      console.log('Binary data is already a Buffer');
      // Already a Buffer
      content = inputData.binary.data.toString('utf-8');
    } else {
      console.log('Binary data is object, attempting Object.values conversion');
      console.log('Object.values length:', Object.values(inputData.binary.data).length);
      // Try to convert object to Buffer
      content = Buffer.from(Object.values(inputData.binary.data)).toString('utf-8');
    }
  } else if (inputData.json && inputData.json.data) {
    console.log('Using json.data');
    // File content is in json.data
    content = inputData.json.data;
  } else if (typeof inputData.json === 'string') {
    console.log('Using direct json string');
    // File content is directly in json
    content = inputData.json;
  } else {
    console.log('Searching for content in json properties...');
    // Fallback - try to find content in any property
    const keys = Object.keys(inputData.json || {});
    console.log('JSON keys to search:', keys);
    for (const key of keys) {
      if (typeof inputData.json[key] === 'string' && inputData.json[key].includes('Component List')) {
        console.log('Found content in key:', key);
        content = inputData.json[key];
        break;
      }
    }
  }

  console.log('Content extracted, length:', content.length);
  console.log('Content preview (first 200 chars):', content.substring(0, 200));

  if (!content) {
    console.log('ERROR: No content found!');
    return [{ json: { error: 'No file content found', inputData: inputData } }];
  }

  const lines = content.split('\n').map(line => line.trim()).filter(line => line.length > 0);
  console.log('Total lines after filtering:', lines.length);
  console.log('First 5 lines:', lines.slice(0, 5));

  const components = [];
  const netConnections = [];

  let currentSection = '';
  let currentNet = null;
  let currentNetId = null;

  for (let i = 0; i < lines.length; i++) {
    const line = lines[i];

    // Detect sections
    if (line === '<<< Component List >>>') {
      console.log('Found Component List section at line', i);
      currentSection = 'components';
      continue;
    }
    if (line === '<<< Wire List >>>') {
      console.log('Found Wire List section at line', i);
      currentSection = 'wires';
      continue;
    }

    // Skip headers and empty lines
    if (line.startsWith('NODE') || line.startsWith('Wire List') || line === '') {
      continue;
    }

    if (currentSection === 'components') {
      // Parse component line: PART_NUMBER DESIGNATOR FOOTPRINT
      const parts = line.split(/\s+/);
      if (parts.length >= 3) {
        const component = {
          component_type: 'component',
          part_number: parts[0],
          designator: parts[1], 
          footprint: parts[2],
          value: parts[0]
        };
        components.push(component);
        if (components.length <= 3) {
          console.log('Added component:', component);
        }
      }
    }

    if (currentSection === 'wires') {
      // Parse net header: [NETID] NET_NAME
      const netMatch = line.match(/^\[(\d+)\]\s+(.+)$/);
      if (netMatch) {
        currentNetId = netMatch[1];
        currentNet = netMatch[2];
        if (netConnections.length < 3) {
          console.log('Found net:', currentNetId, currentNet);
        }
        continue;
      }

      // Parse connection line: DESIGNATOR PIN_NUM PIN_NAME PIN_TYPE PART_VALUE
      if (currentNet && line.includes('  ')) {
        const parts = line.split(/\s+/).filter(p => p.length > 0);
        if (parts.length >= 5) {
          const connection = {
            component_type: 'net_connection',
            net_name: currentNet,
            net_id: currentNetId,
            designator: parts[0],
            pin_number: parts[1],
            pin_name: parts[2],
            pin_type: parts[3],
            part_value: parts.slice(4).join(' ')
          };
          netConnections.push(connection);
          if (netConnections.length <= 3) {
            console.log('Added connection:', connection);
          }
        }
      }
    }
  }

  console.log('Parsing complete!');
  console.log('Total components found:', components.length);
  console.log('Total connections found:', netConnections.length);

  // Combine all data
  const allData = [...components, ...netConnections];
  console.log('Total data items:', allData.length);

  if (allData.length === 0) {
    console.log('ERROR: No data parsed!');
    return [{ json: { error: 'No components or connections parsed', linesCount: lines.length, firstLines: lines.slice(0, 10) } }];
  }

  console.log('Returning', allData.length, 'items');
  console.log('=== NETLIST PARSER END ===');

  return allData.map(item => ({ json: item }));

} catch (error) {
  console.log('ERROR in parser:', error.message);
  console.log('Stack:', error.stack);
  return [{ json: { error: error.message, stack: error.stack } }];
}

